pc.script.createLoadingScreen(function (app) {
    var showSplash = function () {
        console.log(
            "%cDeveloped by Kage Vision",
            "color: white; background: #1e1e1e; font-size: 16px; padding: 6px 12px; border-radius: 4px; font-weight: 600; box-shadow: 0 0 3px rgba(0,0,0,0.3);"
        );

        // splash wrapper
        var wrapper = document.createElement('div');
        wrapper.id = 'application-splash-wrapper';
        document.body.appendChild(wrapper);

        // splash
        var splash = document.createElement('div');
        splash.id = 'application-splash';
        wrapper.appendChild(splash);
        splash.style.display = 'none';

  // Base64 image
    var img = document.createElement('img');
    img.src = 'data:image/jpeg;base64,'; // Buraya base64 verini yaptr
    
    
img.style.position = 'fixed';
img.style.top = '0';
img.style.left = '0';
img.style.width = '100vw';
img.style.height = '100vh';
img.style.objectFit = 'cover'; // cover: krpabilir, contain: boluk brakabilir
img.style.zIndex = '-1'; // Arka planda kalr

    wrapper.appendChild(img);



        var logo = document.createElement('img');
      logo.src = "data:image/png;base64,";
       
        logo.style.display = 'block';
        logo.style.margin = '0 auto';
        splash.appendChild(logo);

        // Show splash screen once everything is ready
        splash.style.display = 'block';
        
        var container = document.createElement('div');
        container.id = 'progress-bar-container';
        splash.appendChild(container);

        var bar = document.createElement('div');
        bar.id = 'progress-bar';
        container.appendChild(bar);
    };

    var hideSplash = function () {
        var splash = document.getElementById('application-splash-wrapper');
        splash.parentElement.removeChild(splash);
    };

/*
    var setProgress = function (value) {
        var bar = document.getElementById('progress-bar');
        if(bar) {
            value = Math.min(1, Math.max(0, value));
            bar.style.width = value * 100 + '%';
        }
    };
*/


    var setProgress = function (value) {
    var bar = document.getElementById('progress-bar');
    if (bar) {
        // nce fake 0.4 ekliyoruz
        var fakeStart = 0.7;

        // value normalde 0 ile 1 arasnda gelir
        // fakeStart ile 1.0 arasna mapliyoruz
        var displayValue = fakeStart + (value * (1 - fakeStart));

        displayValue = Math.min(1, Math.max(0, displayValue));
        bar.style.width = (displayValue * 100) + '%';
    }
};

    var createCss = function () {
        var css = [
            'body {',
            '    margin: 0;',
            '    padding: 0;',
            '    width: 100%;',
            '    height: 100vh;',
            '    background-color: #000000;',  // Ak mavi arka plan
            '    overflow: hidden;',
            '    -webkit-user-select: none;',
            '    -moz-user-select: none;',
            '    -ms-user-select: none;',
            '    user-select: none;',
            '}',
            '',
            '#application-splash-wrapper {',
            '    position: fixed;', // absolute yerine fixed kullanyoruz
            '    top: 0;',
            '    left: 0;',
            '    width: 100%;',
            '    height: 100%;',
            '    display: flex;',
            '    justify-content: center;',
            '    align-items: center;',
            '    flex-direction: column;',
            '    background-color: #000000;',  // Ak mavi arka plan (istee bal, wrapper da ayn renk olabilir)
            '}',
            '',
            '#application-splash {',
            '    display: flex;',
            '    flex-direction: column;',
            '    justify-content: center;',
            '    align-items: center;',
            '    width: 100%;',
            '    max-width: 800px;',
            '    padding: 20px;',
            '    box-sizing: border-box;',
            '}',
            '',
            '#application-splash img {',
            '    width: 80%;',
            '    max-width: 800px;',
            '    height: auto;',
            '    margin-bottom: 30px;',
            '}',
            '',
            '#progress-bar-container {',
            '    width: 100%;',
            '    height: 20px;',
            '    background-color: #1d292c;',
            '    border-radius: 20px;',
            '    overflow: hidden;',
            '    margin-top: 20px;',
            '}',
            '',
            '#progress-bar {',
            '    width: 10%;',
            '    height: 100%;',
            '    background-color: #ADD8E6;',
            '    border-radius: 20px;',
            '    transition: width 0.3s ease;',
            '}',
            '',
            '@media (max-width: 768px) {',
            '    #application-splash img {',
            '        width: 90%;',
            '        max-width: 300px;',
            '    }',
            '    ',
            '    #progress-bar-container {',
            '        width: 90%;',
            '    }',
            '}',
            '',
            '@media (max-height: 500px) {', // Dikey alan kstlysa
            '    #application-splash img {',
            '        max-height: 150px;',
            '        margin-bottom: 15px;',
            '    }',
            '    ',
            '    #progress-bar-container {',
            '        height: 15px;',
            '        margin-top: 15px;',
            '    }',
            '}'
        ].join('\n');

        var style = document.createElement('style');
        style.type = 'text/css';
        if (style.styleSheet) {
            style.styleSheet.cssText = css;
        } else {
            style.appendChild(document.createTextNode(css));
        }

        document.head.appendChild(style);
    };

    createCss();
    showSplash();

    app.on('preload:end', function () {
        app.off('preload:progress');
    });
    app.on('preload:progress', setProgress);
    app.on('start', hideSplash);
});